    <Navbar />
    <Routes>

      {/* <Switch> */}
        <Route path="/patient" element={<PatientPage />}/>  
        <Route path="/insurance" element={<InsurancePage />}/>  
        {/* </Route> */}
        {/* Define routes for other pages */}
        {/* ... */}
      {/* </Switch> */}
    </Routes>
    </BrowserRouter>
  );
};

export default App;
